            .body-window {
                background-color: var(--black);
                border-radius: 20px;
                margin: 7px;
                height: calc(100% - 64px);
            }
            
            .dark-mode {
                background-color: var(--background);
                color: var(--white);
            }
            
            h1 {
                color: var(--red);
            }
            
            h2 {
                color: var(--green);
            }
            
            h3 {
                color: var(--yellow);
            }
            
            a {
                color: var(--yellow);
            }
            
            a:hover {
                color: var(--bright-yellow) !important;
            }
            
            .dark-element {
                background-color: var(--black);
                color: var(--red);
            }

                overflow: hidden;
